package cyc2018.string;

import java.util.*;

/**
 * 给定两个字符串 s 和 t ，编写一个函数来判断 t 是否是 s 的字母异位词。
 *
 * 注意：若 s 和 t 中每个字符出现的次数都相同，则称 s 和 t 互为字母异位词。
 */
public class Code242 {
    public static boolean isAnagram(String s, String t) {
        int length1=s.length();
        int length2=t.length();
        if(length1!=length2){
            return false;
        }
        HashMap<Character, Integer> map1=new HashMap<>();
        HashMap<Character, Integer> map2=new HashMap<>();
        for(int i=0;i<length1;i++){
            char c1=s.charAt(i);
            map1.put(c1,map1.getOrDefault(c1,0)+1);
        }
        for(int j=0;j<length2;j++){
            char c2=t.charAt(j);
            map2.put(c2,map2.getOrDefault(c2,0)+1);
        }
        Set<Character> set=map1.keySet();
        Iterator<Character> it=set.iterator();
        while (it.hasNext()){
            char c=it.next();
            //注意要用equals,不要用==。
            //如果Integer类型的两个数相等，如果范围在-128~127（默认），那么用“==”返回true，其余的范会false。
            if(!map1.get(c).equals(map2.get(c))){
                return false;
            }
        }
        return true;
    }

    public static void main(String[] args) {
        String s = "";
        String t = "";
//        String s="aaccbcbqwertyuiopasdfghjklzxcvbnm";
//        String t="ccaacbbqwertyuiopasdfghjklzxcvbnm";
        System.out.println(isAnagram(s,t));
    }
}
